export const auth = (state = false,action)=>{
    console.log("authSuccessReducerFire")
    switch (action.type) {
        case "AUTH_SUCCESS":
            return true
        default:
            return false
    }
}

export const authCheck = (state = false,action)=>{
    console.log("authSuccessReducerFire")
    switch (action.type) {
        case "AUTH_SUCCESS":
            return true
        default:
            return false
    }
}
